'''Zwiesel Mountain''' ({{lang-de|Zwieselberg}}) is a large complex [[mountain]] which is highly dissected, rising to 2,970 m and forming the north portion of [[Pieck Range]] in the [[Petermann Ranges]] of [[Queen Maud Land]]. It was discovered and given the descriptive name "Zwiesel-Berg" (forked mountain) by the [[Third German Antarctic Expedition]] (1938â1939), led by Capt. [[Alfred Ritscher]].

